{"command": "$targets = @("192.168.1.48", "192.168.1.79", "192.168.1.165", "192.168.1.180", "192.168.1.195", "192.168.1.228", "192.168.1.240")
$ports = @(22, 23, 80, 443, 445, 139, 548, 3389, 5000, 8080, 8443, 9000, 62078)
$portNames = @{22="SSH"; 23="Telnet"; 80="HTTP"; 443="HTTPS"; 445="SMB"; 139="NetBIOS"; 548="AFP"; 3389="RDP"; 5000="NAS-Web"; 8080="HTTP-Alt"; 8443="HTTPS-Alt"; 9000="Web-Mgmt"; 62078="iPhone-Sync"}

Write-Host "=== PORT SCAN RESULTS ===" -ForegroundColor Cyan
foreach ($ip in $targets) {
    Write-Host "`n[$ip]" -ForegroundColor Yellow
    $openPorts = @()
    foreach ($port in $ports) {
        $tcp = New-Object System.Net.Sockets.TcpClient
        $connect = $tcp.BeginConnect($ip, $port, $null, $null)
        $wait = $connect.AsyncWaitHandle.WaitOne(300, $false)
        if ($wait -and $tcp.Connected) {
            $name = if ($portNames[$port]) { $portNames[$port] } else { "Unknown" }
            $openPorts += "$port ($name)"
        }
        $tcp.Close()
    }
    if ($openPorts.Count -gt 0) {
        Write-Host "  Open: $($openPorts -join ', ')" -ForegroundColor Green
    } else {
        Write-Host "  No common ports open (may be filtered)" -ForegroundColor Gray
    }
}", "is_background": false, "explanation": "PowerShell TCP port scan on unknown devices and Apple device for common service ports"}

